export default function getListStudents() {
  const arr = new Array();

  class student {
    constructor(id, firstName, location) {
      this.id = id;
      this.firstName = firstName;
      this.location = location;
    }
  }

  const obj1 = new student(1, 'Guillaume', 'San Francisco');
  const obj2 = new student(2, 'James', 'Columbia');
  const obj3 = new student(5, 'Serena', 'San Francisco');

  arr.push(obj1, obj2, obj3);

  return arr;
}

